        Project.ProjectTecnos = Seleccionados.Select(x => new ProjectTecnos { TecnoId = int.Parse(x.Llave) }).ToList();

        if (!string.IsNullOrEmpty(Project.Poster))
        {
            imagenURL = null;
        }

        await OnValidSubmit.InvokeAsync(null);
    }




